The forgetful functor Ab \xrightarrow {U}
Set admits a left adjoint, called the free
abelian group functor.

First let L\perp  R. Let x\xrightarrow {f} y be any map and let
  x\xrightarrow {l}z\xrightarrow {r} y and x\xrightarrow {l'} z'\xrightarrow {r'} y be factorizations, i.e. so
  we have a lifting problem 




