  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }


		\begin {tikzcd}
			& (x\otimes  y)\otimes (z\otimes  w) 
	       \ar [dr, "\alpha _{x, y, z\otimes  w}"]
	       \\
			((x\otimes  y)\otimes  z)\otimes  w
	       \ar [ur, "\alpha _{x\otimes  y, z, w}"]
	       \ar [d, "\alpha _{x, y, z}\otimes  1_w"']
	     & & x\otimes  (y\otimes  (z\otimes  w)) \\
			(x\otimes  (y\otimes  z))\otimes  w
	       \ar [rr, "\alpha _{x, y\otimes  z, w}"']
	     & & x\otimes  ((y\otimes  z)\otimes  w)\makebox [0pt][l]{.}
	       \ar [u, "1_x\otimes \alpha _{y, z, w}"']
		\end {tikzcd}

Let F\dashv  G be an adjunction. Then
the unit and counit 1\xrightarrow {\eta } GF and FG\xrightarrow {\epsilon } 1 make
the following diagrams, called the triangle identities, commute:




